import react from "react";
import Card from "../../UI/Card";

const DayCard = (props) => {
    console.log("in DayCard.js");
    console.log(props.dailyForecast);

    const imgURL = `owf owf-${props.dailyForecast.icon} owf-5x`


    return (
        /*<div>
            {props.dailyForecast && props.dailyForecast.dayName}
            {props.dailyForecast && props.dailyForecast.icon}
            {props.dailyForecast && props.dailyForecast.minTemp}
            {props.dailyForecast && props.dailyForecast.maxTemp}
        </div>*/
        <div className="col-sm-2">
            <div className="card">
                <h3 className="card-title">{props.dailyForecast.dayName}</h3>
                <p className="text-muted">{props.dailyForecast.dayName}</p>
                <i className={imgURL}>props.dailyForecast.icon</i>
                <h2>{Math.round(props.dailyForecast.minTemp)}</h2>
                <h2>{Math.round(props.dailyForecast.maxTemp)}</h2>
                <div className="card-body">
                    <p className="card-text">{props.dailyForecast.dayName}</p>
                </div>
            </div>
        </div>
    );
}

export default DayCard;
